import React from 'react';
import paper from './images/icon-paper.svg';

const Paper = () => {
    return(
        <div>
             <button className='paper'>
                <div>
                     <img src={paper} alt=''></img>
                </div>
            </button>
        </div>
    )
}

export default Paper;
